import ExpenseItem from "./components/Expenses/ExpenseItem";
import NewExpense from "./components/NewExpense/NewExpense";

function App() {
  const Expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      price: "$566.7",
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "Toilet Paper",
      price: "$200.7",
      date: new Date(2021, 7, 14),
    },
    {
      id: "e3",
      title: "New TV",
      price: "$378.8",
      date: new Date(2022, 3, 29),
    },
    {
      id: "e4",
      title: "New Desk",
      price: "$109.7",
      date: new Date(2022, 8, 21),
    },
  ];

  const ExpeseDisplay = Expenses.map((expense) => {
    return <ExpenseItem />;
  });
  return (
    <div>
      <NewExpense />
      <div className="container expenseBg">
        <ExpenseItem title="Car Insurence" price="$356.67" />
        <ExpenseItem title="Toilet Paper" price="$567.03" />
        <ExpenseItem title="New TV" price="$678.78" />
        <ExpenseItem title="New Desk" price="$289.78" />
      </div>
    </div>
  );
}

export default App;
